function ju_clip(text){if(navigator.userAgent.match(/ipad|ipod|iphone/i)){$("#modal-content-inner span").remove();$("#modal-content-inner").prepend("<span>"+select_copy+" : <strong>"+text+"</strong></span>");$("#modal-content,#ju-alert").toggleClass("active");}else{var el=document.createElement('input');el.setAttribute('type','text');el.setAttribute('value',text);el=document.body.appendChild(el);if(document.body.createTextRange){var textRange=document.body.createTextRange();textRange.moveToElementText(el);textRange.select();textRange.execCommand("Copy");el.remove();return true;}else if(window.getSelection&&document.createRange){var editable=el.contentEditable;var readOnly=el.readOnly;el.contentEditable=true;el.readOnly=false;var range=document.createRange();range.selectNodeContents(el);var sel=window.getSelection();sel.removeAllRanges();sel.addRange(range);if(el.nodeName=="TEXTAREA"||el.nodeName=="INPUT")
el.select();if(el.setSelectionRange&&navigator.userAgent.match(/ipad|ipod|iphone/i))
el.setSelectionRange(0,999999);el.contentEditable=editable;el.readOnly=readOnly;if(document.queryCommandSupported("copy")){var successful=document.execCommand('copy');el.remove();if(successful){return true;}else{window.prompt("Press CTRL+C to copy",text);return false;}}else{el.remove();if(!navigator.userAgent.match(/ipad|ipod|iphone/i)){window.prompt("Press CTRL+C to copy",text);return false;}}}}}
function ju_hasTouch(){if(navigator.userAgent.match(/ipad|ipod|iphone|android|silk/i)){return window.ontouchstart!==undefined;}else{return false;}}